<!DOCTYPE html>

<html lan="pt">
    <head>
        <title>LoremIpsum</title>
        <link href="static.css" rel="stylesheet ">
        <script>
            document.addEventListener('DOMContentLoaded', function yep(){
                const cores = document.querySelectorAll('.colors');
                for(let cor of cores){
                    cor.onclick = (e) => {
                        let cor = document.querySelector('.cor');
                        let cor2 = document.querySelector('.cor2');
                        botao = event.target;
                        if(botao.classList.contains('red')){
                            cor.style.stroke = '#ff3232';
                            cor2.style.fill = '#ff3232';
                        }
                        else if(botao.classList.contains('blue')){
                            cor.style.stroke = '#4c86ff';
                            cor2.style.fill = '#4c86ff';
                        }
                        else if(botao.classList.contains('green')){
                            cor.style.stroke = '#43803f';
                            cor2.style.fill = '#43803f';
                        }
                        else if(botao.classList.contains('yellow')){
                            cor.style.stroke = '#ffd805';
                            cor2.style.fill = '#ffd805';
                        }
                        else if(botao.classList.contains('pink')){
                            cor.style.stroke = 'pink';
                            cor2.style.fill = 'pink';
                        }
                    }
                }
                
                const confirmar2 = document.querySelector('.confirmar2');
                confirmar2.onclick = (e) =>{
                    event.preventDefault();
                    let valorcor = document.querySelector('.inputcor');
                    let text1 = document.querySelectorAll('.textocor');
                    for(let text of text1){
                        text.style.fill = `${valorcor.value}`;
                    }
                }
            });
        </script>
    </head>

        <form class="controls inputs">
            <input type="text" placeholder="cor do texto, valor hex ou rgb" style="width:200px;" class="inputcor"></input> 
            <input type="submit" id="confirmar" class="confirmar2 confirmar"></button>
        </form>
